import { Link } from 'react-router-dom';

const Nav = () => {
  return ( 
    <nav className="main-nav">
        <ul>
          <li><Link to="/search/cats">cats</Link></li>
          <li><a href='#'>Dogs</a></li>
          <li><a href='#'>Computers</a></li>
        </ul>
      </nav>
   );
}

export default Nav;
